import React from 'react';
const Loading = () => {
	return (
		<div className='load-page'>
			<div className='loader'>
				<div>
					<div>
						<div>
							<div>
								<div>
									<div>
										<div></div>
									</div>
								</div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Loading;
